import React from "react";
import './Message.css'

const Messages = ({ messages }) => {
    return (
        <ul className="overflow-auto mh-100">
        {messages.map((message, index) =>(
            <li class="list-group-item" key={index}>{message}</li>
        ))}
        </ul>
    )
};

export default Messages;
